    IN p_cus_id INT,
    IN p_item_name VARCHAR(255),
    IN p_service_id INT,
    IN p_unit_value DECIMAL(10,2),
    IN p_ship_id INT,
    IN p_status VARCHAR(50),
    IN p_payment_status VARCHAR(50)
)
BEGIN
    DECLARE error_occurred BOOLEAN DEFAULT FALSE;
    DECLARE old_stat VARCHAR(50);
    DECLARE new_stat VARCHAR(50);

    START TRANSACTION;
    UPDATE shipment 
    SET cus_id = p_cus_id, 
        item_name = p_item_name, 
        service_id = p_service_id, 
        unit_value = p_unit_value 
    WHERE ship_id = p_ship_id;
    IF ROW_COUNT() = 0 THEN
        SET error_occurred = TRUE;
    END IF;

   IF NOT error_occurred THEN
        UPDATE `transaction`
        SET payment_status = p_payment_status 
        WHERE ship_id = p_ship_id;
        IF ROW_COUNT() = 0 THEN
            SET error_occurred = TRUE;
