   END IF;
   
   IF NOT error_occurred THEN
        SELECT status INTO old_stat FROM tracking_details WHERE ship_id = p_ship_id;
   END IF;

   IF NOT error_occurred THEN
        UPDATE tracking_details 
        SET status = p_status 
